      out.write("\t\t\t\t\t\t\t<h3 class=\"blog_head color1\"><a href=\"#\">现如今，“养生”似乎已经成了一个时髦词，早睡早起、劳逸适度、添衣保暖这些都没问题，但要我戒糖戒奶茶，那这季节还有什么灵魂？没关系！\r\n");
